import MenuItems from "./MenuItems";

export default function Menu(props) {
  console.log(props.Menu);
  return (
    <div>
      {props.Menu.map((items) => {
        <MenuItems
          key={items.id}
          dish={items.name}
          discription={items.description}
          price={items.price}
        />;
      })}
    </div>
  );
}
